import React, { Component } from "react";

class PERSONAS extends Component {
  state = {
    verP: false,
  };

  mostrarP=()=>{
      this.setState({
        verP:!this.state.verP
      });
  }
  render() {
    const { personas } = this.props;
    return (
      <div>
          
        <ul>
          {personas.map((el) => (
            <li key={el.cedula}>{el.nombre}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default PERSONAS;
